var resetRatioParams = function() 
{
    projWideSlider.value = 1; 
    projHighSlider.value = 1; 
    shapeName.text = "Enter Name Here";
    pixelOverlapH.text = 100;
    pixelOverlapW.text = 100;
    updateSlideDisplay;
    usrInputWidth.text = 1200;
    usrInputHeight.text = 1920;
    inPoisitionX.text = 0;
    inPoisitionY.text = 0;
}

var updateSlideDisplay = function()
{
    heightAmountIndicator.text = projHighSlider.value;
    widthAmountIndicator.text = projWideSlider.value;
}

var createCompsFromShapes = function() 
{
    var shapeLayers = [];

    var baseComp = comp;
    
    for(i = 1; i <= comp.layers.length; i++)
    {
        if(comp.layer(i) instanceof ShapeLayer)
        {
            shapeLayers.push(comp.layer(i));
        }
    } 

    app.beginUndoGroup("CompCreation");

    for(j = 0; j < shapeLayers.length; j++)
    {
        var curLayer = shapeLayers[j];
        var curName = curLayer.name;
        var curSize = curLayer.property("Contents").property("Rectangle 1").property("Contents").property(1).property("Size").value;
        var curPos = curLayer.property("Transform").property(2).value;

        var newComp = app.project.items.addComp(curName, curSize[0], curSize[1], 1, baseComp.duration, baseComp.frameRate);
        var newCompLayer = newComp.layers.add(baseComp);
        newCompLayer.property("Transform").property(2).setValue([curPos[0] * -1, curPos[1] * -1]);
        newCompLayer.property("Transform").property(1).setValue([0,0]);


        curLayer.enabled = false;


        // alert(curLayer.property("Transform").property(2).value);  
    }

    app.endUndoGroup();
}

